import styled from "styled-components";
import { motion } from "framer-motion";

const TagLIstComponentStyle = styled(motion.div)`
  width: auto;
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  font-size: 16px;
  margin-top: 200px;
  .tag {
    width: auto;
    height: auto;
    padding: 10px;
    margin-right: 20px;
    color: #c1c0c4;
  }
  &:first-child {
    color: green;
  }
`;

const TagLIstComponent = ({ list = [] }) => {
  return (
    <TagLIstComponentStyle>
      {(list || ["health", "traveling", "media", "news", "psychologie"]).map(
        (e, i) => {
          console.log(e);
          return (
            <motion.span
              key={i}
              whileHover={{ backgroundColor: "white", color: "black" }}
              className={"tag tag" + e}
            >
              {e}
            </motion.span>
          );
        }
      )}
    </TagLIstComponentStyle>
  );
};

export default TagLIstComponent;
